import "./app.css"
function App() {
  return (
    <div className="app">
     <div className="main">main</div>
     <div className="pyramid">
      <div className="moneyList">
        <div className="moneyListItem">$ 200</div>
        <div className="moneyListItem">$ 300</div>
        <div className="moneyListItem">$ 400</div>
        <div className="moneyListItem">$ 500</div>
        <div className="moneyListItem">$ 600</div>
        <div className="moneyListItem">$ 700</div>
      </div>
     </div>
    </div>
  );
}

export default App;
